import { Grid, Typography } from '@mui/material';
import '../../../style/home.css';
import logo from '../../../photo/png/logo-color.png';
function Home() {
  return (
    <Grid
      className="home-page"
      container
      direction="row"
      justifyContent="center"
      alignItems="center"
    >
      <Grid item className="home-items" xs={6}>
        <Typography color="#00d1cd" variant="h2">
          {'DK IT SERVICES'}
        </Typography>
        <Typography color="white">
          {'Vitajte v DK IT SERVICES, spoločnosti s vášou digitálnou výhodou!'}
        </Typography>
        <Typography color="white">
          {
            'Sme tím vášnivých programátorov, ktorí sa špecializujú na vytváranie inovatívnych riešení. Našou vášňou je kódovanie a naším cieľom je prinášať najmodernejšie a najefektívnejšie softvérové produkty.'
          }
        </Typography>
        <Typography color="white">
          {
            'Sme presvedčení, že technológia má moc zmeniť svet. Preto sa s nadšením vrháme do výziev a prinášame klientskym spoločnostiam konkurenčnú výhodu pomocou šitých softvérových riešení. Od mobilných aplikácií po webové platformy, naša kreativita a odbornosť nám umožňujú transformovať vaše myšlienky na skutočnosť.'
          }
        </Typography>
        <Typography color="white">
          {
            'V DK IT SERVICES nie sme len dodávateľmi, sme vaším partnerom na dlhodobú spoluprácu. Zameriavame sa na porozumenie vašich potrieb a cieľov, aby sme vytvorili výnimočné riešenia, ktoré vás budú poháňať dopredu. S našou skúsenosťou a odbornosťou sme pripravení prekonať technologické prekážky a poskytnúť vám programovanie na najvyššej úrovni.'
          }
        </Typography>
        <Typography color="white">
          {
            'Pripojte sa k nám a spolu vytvorme digitálnu budúcnosť. DK IT SERVICES je tu pre vás, aby sme prekonali vaše očakávania a priniesli vaše programovacie projekty na novú úroveň úspechu.'
          }
        </Typography>
        <Typography color="white">
          {
            'Nečakajte, kontaktujte nás ešte dnes a začnime spolu tkať kódové dielo, ktoré zmení svet!'
          }
        </Typography>
      </Grid>
      <Grid item className="home-items" xs={5}>
        <img className="home-logo" src={logo} alt={'logo'} />
      </Grid>
    </Grid>
  );
}
export { Home };
